import React from "react";
import { Bar } from "react-chartjs-2";
import { Chart, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from "chart.js";

Chart.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

const DietPlan = () => {
  const data = {
    labels: ["Underweight", "Normal weight", "Overweight", "Obese"],
    datasets: [
      {
        label: "Recommended Weight Gain (kg)",
        data: [15, 13.75, 9.25, 7],
        backgroundColor: ["#8e44ad", "#9b59b6", "#d2b4de", "#e8daef"],
        borderWidth: 1,
      },
    ],
  };

  const options = {
    responsive: true,
    maintainAspectRatio: false,
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  return (
    <div className="min-h-screen bg-gray-100 py-10 px-6">
      {/* Cover Image */}
      <div className="w-full h-64 bg-cover bg-center rounded-xl shadow-lg mb-6" 
           style={{ backgroundImage: 'url("/images/food.jpg")' }}>
      </div>
      
      <div className="max-w-4xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-6">
      <h1 className="text-xl font-semibold text-purple-700 text-center">Healthy Diet During Pregnancy</h1>
        {/* Section 1 */}
        <div className="bg-white p-6 rounded-xl shadow-md">
         
          <h2 className="text-lg font-semibold text-purple-700 mt-4">Healthy Weight Gain During Pregnancy</h2>
          <p className="text-gray-700">Steady weight gain is essential for both the baby’s development and the mother's health.</p>
        </div>

        {/* Section 2 */}
        <div className="bg-white p-6 rounded-xl shadow-md">
          <h3 className="text-lg font-semibold text-purple-700">Importance of Healthy Weight Gain</h3>
          <ul className="list-disc list-inside text-gray-700">
            <li>Supports baby’s growth and development.</li>
            <li>Essential for maternal health and postpartum recovery.</li>
          </ul>
        </div>

        {/* Section 3 */}
        <div className="bg-white p-6 rounded-xl shadow-md">
          <h3 className="text-lg font-semibold text-purple-700">Risks of Excess Weight Gain</h3>
          <ul className="list-disc list-inside text-gray-700">
            <li>Increases chances of gestational diabetes and high blood pressure.</li>
            <li>Can make it harder to lose weight after pregnancy.</li>
          </ul>
        </div>

        {/* Section 4 */}
        <div className="bg-white p-6 rounded-xl shadow-md">
          <h3 className="text-lg font-semibold text-purple-700">Recommended Weight Gain (Based on BMI)</h3>
          <ul className="list-disc list-inside text-gray-700">
            <li><b>Underweight (BMI &lt; 18.5)</b> → 12.5 - 18 kg</li>
            <li><b>Normal weight (BMI 18.5 - 24.9)</b> → 11.5 - 16 kg</li>
            <li><b>Overweight (BMI 25 - 29.9)</b> → 7 - 11.5 kg</li>
            <li><b>Obese (BMI ≥ 30)</b> → 5 - 9 kg</li>
          </ul>
        </div>
      </div>

      {/* Chart Section */}
      <div className="max-w-4xl mx-auto mt-8 bg-white p-6 rounded-xl shadow-md">
        <h3 className="text-lg font-semibold text-purple-700">Weight Gain Chart</h3>
        <div className="w-full h-64">
          <Bar data={data} options={options} />
        </div>
      </div>
    </div>
  );
};

export default DietPlan;
